import styles from "./Main.module.scss";

import { LeftBar } from "../barLeft";
import { News } from "../../pages/news";
export function Main() {
  return (
    <main className={styles.main}>
      <div className="content">
        <div>
          <LeftBar />
        </div>
      </div>
    </main>
  );
}
